import { memo } from 'react'
import { Link } from 'react-router-dom'
import NotFoundImage from '../../images/404.png'
import './NotFound.scss'

function NotFound() {
    const role = sessionStorage.getItem('role')

    return (
        <div className='container not-found'>
            <img src={NotFoundImage} className='w-35' />
            <label className='not-found-text mt-20'>Page not found</label>
            <label className='mb-50'>Click <Link className='link-back-home' to={role != 1 ? '/' : '/admin/dashboard'}>here</Link> to go back to the home page</label>
        </div>
    )
}

export default memo(NotFound)
